import React from 'react';

const Filter = ({ filterType, filterParams = [], handleClick }) => (
  <div className="filter-product-box dropdown show" >
    <div className="filter-header">
      <h4>{filterType}</h4>
    </div>
    <a class="btn btn-secondary dropdown-toggle" href="#" role="button" id="dropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
      Dropdown link
    </a>
    {filterParams.map(({ value, label }) => (
      <React.Fragment className="check-styles" aria-labelledby="dropdownMenuLink" key={label}>
        <div className="check-alignment dropdown-menu">
          <input type="checkbox" value={value} onClick={() => handleClick(filterType, value)} />
          <label for="exampleRadios1">
            {label}
          </label>
        </div>
        {/* <label>{label}</label>
        <input type="checkbox" value={value} onClick={() => handleClick(filterType, value)} /> */}
      </React.Fragment>
    ))}
  </div>
)

export default Filter;

